import Best from './bestOf/Best';
import BookShelf from './bookShelf/BookShelf';

class Main extends Component {
  render() {
    return (
      <div className='Main'>
        <Best></Best>
        <BookShelf></BookShelf>
      </div>
    );
  }
}

export default Main;
